pragma solidity ^0.8.8;

contract MyToken {
    ////////////////State Variables///////////////////////
 address private  admin;
 string public constant name = "Shiba-Inu";
 string public constant symbol = "SI";
 uint256 public totalSupply = 1000 * 10 ** 10;
 uint256 public immutable decimals; 
 ////////////////////////////////Events//////////////////////////////

    event Transfer(address indexed recipient, address indexed to, uint256 amount);
    event Allowance(address indexed from, address indexed to, uint256 amount);
    
    //////////////////////Mappings///////////////////////

    mapping(address=>uint256) private balances;
    mapping(address=>mapping(address=>uint256)) private allowed;

    constructor() {
        admin = msg.sender;
        balances[msg.sender] = totalSupply;
        decimals = 10;
    } 

///////////////////////////Modifier///////////////////

    modifier onlyAdmin() {
        require(msg.sender == admin,"You are not allowed to do that");
        _;
    }

    /////////////////////Main Functions///////////////////////////

    function transfer(address reciever, uint256 amount) public returns(bool){
        require(balances[msg.sender] >= amount,"You dont have enough tokens to transfer");
        require(reciever != address(0),"This address does not exist");
        balances[msg.sender] -= amount;
        balances[reciever] += amount;

        emit Transfer(msg.sender,reciever,amount);
        return true;
    }

    function mint(uint256 quantity) public onlyAdmin returns(uint256){
        totalSupply += quantity;
        balances[msg.sender] += quantity;
        return totalSupply;
    }

    function burn(uint256 amount) public onlyAdmin returns(uint256) {
        require(balances[msg.sender] >= amount,"You have enough tokens to burn");
        balances[msg.sender] -= amount;
        totalSupply -= amount;
        return totalSupply;
    }

    function approval(address _spender, uint256 _value) public returns(bool success) {
         allowed[msg.sender][_spender] = _value;
         
         emit Allowance(msg.sender,_spender,_value);
         return true;
    } 

    function transferFrom(address _from, address _to, uint256 _value) public returns(bool success) {
        uint256 allowedTokens = allowed[_from][msg.sender];
        require(balances[_from] >= _value && allowedTokens>=_value);
        balances[_to] += _value;
        balances[_from] -= _value;
        allowed[_from][msg.sender] -= _value;

        emit Transfer(_from, _to, _value);
        return true;
    }


    ////////////////View Functions//////////////////////


    
    function allowance(address _owner, address _spender) public view returns(uint256){
       return allowed[_owner][_spender];
    }

    
    function balanceOf(address user) public view returns(uint256){
        return balances[user];
    }


}","keccak256":"0xc267b08368ff788712423d09b2b44451254d2c8adfb87fed8b17d1aef45dc415","license":"GPL-3.0"},"contracts/NFT.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "./MyToken.sol";

error NFT__DontHaveEnoughTokensToMintNFT();
error NFT__YouDidntProvideApprovalOFTokensForNFTMinting();
error NFT__TransferFailed();
error NFT__NFTMintingLimitReached();
contract NFT is ERC721URIStorage {
////////////////////////////////Struct//////////////////////////////////////////
struct NFTDetails {
    uint256 tokenid;
    address owner;
}
    ////////////////////////////State Variables//////////////////////////////////
    
    uint256 private s_tokenCounter;
      MyToken private immutable token;
      uint256 private constant VALUE = 5000000000;

    /////////////////////////mapping////////////////////////////////////
    mapping(uint256 => NFTDetails) private details;

    //////////////////////////Events////////////////////////////////////
    event NFTMinted( address indexed owner, address indexed nftAddress, uint256 indexed tokenId);
    constructor(address _token) ERC721("My NFT", "MN") {
        s_tokenCounter = 0;
        token = MyToken(_token);
    }

///////////////////////Main Function////////////////////////////////////

    function mintNft(string memory _tokenURI) public returns (uint256) {

        if(s_tokenCounter > 2) {
            revert NFT__NFTMintingLimitReached();
        }
    
        if(token.balanceOf(msg.sender) < VALUE){
            revert NFT__DontHaveEnoughTokensToMintNFT(); 
        }
        if(token.allowance(msg.sender, address(this)) < VALUE) {
            revert NFT__YouDidntProvideApprovalOFTokensForNFTMinting();
        }
   
        (bool success) = token.transferFrom(msg.sender, address(this), VALUE);

        if(!success) {
            revert NFT__TransferFailed();
        }

        _safeMint(msg.sender, s_tokenCounter);
        _setTokenURI(s_tokenCounter, _tokenURI);
        details[s_tokenCounter] = NFTDetails(s_tokenCounter,msg.sender);
        emit NFTMinted(msg.sender, address(this), s_tokenCounter);
        s_tokenCounter = s_tokenCounter + 1;
        return s_tokenCounter;
    }
///////////////////////Getter Functions////////////////////////////////////

 function getAllNFTs() public view returns (NFTDetails[] memory) {
       
        NFTDetails[] memory nfts = new NFTDetails[](s_tokenCounter);

        for(uint i=0;i<s_tokenCounter;i++)
        {
            NFTDetails storage currentItem = details[i];
            nfts[i] = currentItem;
        }
        return nfts;
    }

    function getTokenCounter() public view returns (uint256) {
        return s_tokenCounter;
    }
    function mintingFees() public pure returns(uint256) {
        return VALUE;
    }

}","keccak256":"0x8a776f43b5346e205e06a3bcfc460da1cbb55c1604f49d44feeedc94e78a76a5","license":"MIT"}},"version":1}
